import { Link } from "react-router-dom";
import './InitialProfileCard.css'
export default function InitialProfileCard({link, name, bg, children, customClass}) {
  return (
    <li className='initial_profile__item'>
      <Link to={link} className={`initial_profile__avatar ${customClass}`} id={`user${bg}`}>
      {children}
      </Link>
      <span className='initial_profile__name'>{name}</span>
    </li>
  )
}
